// src/modules/counter.js

// 초기 상태값
// 배열, 객체 다 됨
const initialState = {
  number: 0,
};

// 리듀서 - 변화를 일으키는 함수
// state에 할당을 해줘야하고 action을 넘겨줘야한다.
const counter = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

// 모듈파일에서는 리듀서를 export default 한다.
export default counter;
